import React from 'react';
import './Techs.css';

function Techs() {
    return (
        <section className="techs">
            <h2 className="techs__title">Технологии.</h2>
            <h3 className="techs__subtitle">7 технологий</h3>
            <p className="techs__text">На курсе веб-разработки мы освоили технологии, которые применили в дипломном проекте.</p>
            <div className="techs__buttons">
                <button className="techs__button" aria-label="Кнопка HTML" type="button">HTML</button>
                <button className="techs__button" aria-label="Кнопка технологии" type="button">Технологии</button>
                <button className="techs__button" aria-label="Кнопка студент" type="button">Студент</button>
            </div>
        </section>
    );
}

export default Techs;
